import classes from "./styles.module.css"

const Event = ({event}) =>
{

    return (
        <div className={classe.Event}>
            <p>Название: {event.name}</p>
            <p>Дата: {event.date}</p>
            <p>Время: {event.time}</p>
            <p>Описание: {event.body}</p>
            <p>Место: {event.place}</p>
            <button>Изменить</button>
        </div>
    )
}

export default Event;
